  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Section 4558 (b) of the Balanced Budget
  Act (BBA) requires CMS to develop and implement by January 1, 2000, a method to
  measure and report the quality of renal dialysis services provided under the Medicare
  program. To implement this legislation, CMS decided to fund the development of CPMs
  based on the National Kidney Foundations Dialysis Outcome Quality Initiative (DOQI)
  Clinical Practice Guidelines.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
